DROP TABLE IF EXISTS `fbs_receipt_report`;
CREATE TABLE `fbs_receipt_report` (
  `receipt_number` varchar(100) DEFAULT NULL COMMENT '收据号',
  `business_type` varchar(100) DEFAULT NULL COMMENT '业务类型',
  `contract_no` varchar(100) DEFAULT NULL COMMENT '合同号',
  `customer_name` varchar(100) DEFAULT NULL COMMENT '客户姓名',
  `name_of_owner` varchar(100) DEFAULT NULL COMMENT '业主姓名',
  `amount` varchar(100) DEFAULT NULL COMMENT '金额',
  `receipt_approver` varchar(100) DEFAULT NULL COMMENT '收据审批人',
  `receipt_approval_time` varchar(100) DEFAULT NULL COMMENT '收据审批时间',
  `receipt_item` varchar(100) DEFAULT NULL COMMENT '收款项目',
  `usage_time` varchar(100) DEFAULT NULL COMMENT '使用时间',
  `recorder` varchar(100) DEFAULT NULL COMMENT '录入人',
  `deposit_date` varchar(100) DEFAULT NULL COMMENT '存入日期',
  `bank_name` varchar(100) DEFAULT NULL COMMENT '银行名称',
  `bank_card_number` varchar(100) DEFAULT NULL COMMENT '银行卡号',
  `serial_number` varchar(100) DEFAULT NULL COMMENT '流水号',
  `terminal_number` varchar(100) DEFAULT NULL COMMENT '终端号',
  `payment_method` varchar(100) DEFAULT NULL COMMENT '收款方式',
  `deal_shop` varchar(100) DEFAULT NULL COMMENT '成交店',
  `store_number` varchar(100) DEFAULT NULL COMMENT '店面编码',
  `group` varchar(100) DEFAULT NULL COMMENT '组团',
  `group_code` varchar(100) DEFAULT NULL COMMENT '组团编码',
  `region` varchar(100) DEFAULT NULL COMMENT '大区',
  `region_code` varchar(100) DEFAULT NULL COMMENT '大区编码',
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=145 DEFAULT CHARSET=utf8;

